import Nav from "../src/components/Nav";
import Main from "../src/components/Main";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faInstagram, faYelp } from '@fortawesome/free-brand-svg-icons';

library.add(
  faFacebook,
  faInstagram,
  faYelp
  // more icons go here
);



const Index = () => {
  return (
      <div>
          <Nav/>
          <Main/>
      </div>
  );
};

export default Index;
